Movie Info: Issaq is 2013 Hindi romantic film directed by Manish Tiwary and produced by Dhaval Gada and Shailesh R. Singh. The film, written by Padmaja Thakore-Tiwary, Manish Tiwary and Pawan Sony, is to be released on July 26, 2013. The film features Prateik Babbar, Rajeshwari Sachdev, Ravi Kishan and Makarand Deshpande as main characters.

